# =============================================================================
# Bivector Squared Scalar (Helper for exp_bivector)
# =============================================================================

@torch.jit.script
def bivector_squared_scalar(B: Tensor) -> Tensor:
    """
    Compute the scalar part of B.

    Args:
        B: Bivector, shape (..., 21)

    Returns:
        Scalar B value, shape (...,)
    """
    r = (
        -B[..., 0] * B[..., 0] +
        -B[..., 1] * B[..., 1] +
        -B[..., 2] * B[..., 2] +
        -B[..., 3] * B[..., 3] +
        -B[..., 4] * B[..., 4] +
        B[..., 5] * B[..., 5] +
        -B[..., 6] * B[..., 6] +
        -B[..., 7] * B[..., 7] +
        -B[..., 8] * B[..., 8] +
        -B[..., 9] * B[..., 9] +
        B[..., 10] * B[..., 10] +
        -B[..., 11] * B[..., 11] +
        -B[..., 12] * B[..., 12] +
        -B[..., 13] * B[..., 13] +
        B[..., 14] * B[..., 14] +
        -B[..., 15] * B[..., 15] +
        -B[..., 16] * B[..., 16] +
        B[..., 17] * B[..., 17] +
        -B[..., 18] * B[..., 18] +
        B[..., 19] * B[..., 19] +
        B[..., 20] * B[..., 20]
    )
    return r

# =============================================================================
# Bivector Exponential Map
# =============================================================================

@torch.jit.script
def exp_bivector(B: Tensor) -> Tensor:
    """
    Compute exponential map from Bivector to EvenVersor.

    exp(B) = cos() + sinc() * B
    where  = -B (for rotation bivectors)

    Args:
        B: Bivector, shape (..., 21)

    Returns:
        EvenVersor, shape (..., 64)

    Note:
        Uses torch.sinc for numerical stability at 0
    """
    # Compute B scalar
    B_sq = bivector_squared_scalar(B)

    #  = -B (for rotation bivectors, B is negative)
    theta_sq = torch.clamp(-B_sq, min=1e-12)
    theta = torch.sqrt(theta_sq)

    # cos() and sinc() = sin()/
    cos_theta = torch.cos(theta)
    # torch.sinc(x) = sin(x)/(x), so sinc(/) = sin()/
    sinc_theta = torch.sinc(theta / 3.141592653589793)

    # Build even_versor: scalar part = cos(), bivector parts = sinc() * B
    r0 = cos_theta  # 1
    r1 = sinc_theta * B[..., 0]  # e1e2
    r2 = sinc_theta * B[..., 1]  # e1e3
    r3 = sinc_theta * B[..., 2]  # e1e4
    r4 = sinc_theta * B[..., 3]  # e1e5
    r5 = sinc_theta * B[..., 4]  # e1e+
    r6 = sinc_theta * B[..., 5]  # e1e-
    r7 = sinc_theta * B[..., 6]  # e2e3
    r8 = sinc_theta * B[..., 7]  # e2e4
    r9 = sinc_theta * B[..., 8]  # e2e5
    r10 = sinc_theta * B[..., 9]  # e2e+
    r11 = sinc_theta * B[..., 10]  # e2e-
    r12 = sinc_theta * B[..., 11]  # e3e4
    r13 = sinc_theta * B[..., 12]  # e3e5
    r14 = sinc_theta * B[..., 13]  # e3e+
    r15 = sinc_theta * B[..., 14]  # e3e-
    r16 = sinc_theta * B[..., 15]  # e4e5
    r17 = sinc_theta * B[..., 16]  # e4e+
    r18 = sinc_theta * B[..., 17]  # e4e-
    r19 = sinc_theta * B[..., 18]  # e5e+
    r20 = sinc_theta * B[..., 19]  # e5e-
    r21 = sinc_theta * B[..., 20]  # e+e-
    r22 = torch.zeros_like(cos_theta)  # e1e2e3e4
    r23 = torch.zeros_like(cos_theta)  # e1e2e3e5
    r24 = torch.zeros_like(cos_theta)  # e1e2e3e+
    r25 = torch.zeros_like(cos_theta)  # e1e2e3e-
    r26 = torch.zeros_like(cos_theta)  # e1e2e4e5
    r27 = torch.zeros_like(cos_theta)  # e1e2e4e+
    r28 = torch.zeros_like(cos_theta)  # e1e2e4e-
    r29 = torch.zeros_like(cos_theta)  # e1e2e5e+
